Section names.

Class GlobalAddrs :=
{
  GlobalX : loc;
  globalY : loc;
  globalA : loc;
  globalB : loc;
  mapLiteral : loc;
  mapLiteralWithConversion : loc;
}.

Context `{!GlobalAddrs}.
Context `{!heapGS Σ}.
Context `{!goGlobalsGS Σ}.

Definition var_addrs : list (go_string * loc) := [
    ("GlobalX"%go, GlobalX);
    ("globalY"%go, globalY);
    ("globalA"%go, globalA);
    ("globalB"%go, globalB);
    ("mapLiteral"%go, mapLiteral);
    ("mapLiteralWithConversion"%go, mapLiteralWithConversion)
  ].

Definition is_defined := is_global_definitions unittest.pkg_name' var_addrs unittest.functions' unittest.msets'.

Definition own_allocated `{!GlobalAddrs} : iProp Σ :=
  "HGlobalX" ∷ GlobalX ↦ (default_val w64) ∗
  "HglobalY" ∷ globalY ↦ (default_val go_string) ∗
  "HglobalA" ∷ globalA ↦ (default_val go_string) ∗
  "HglobalB" ∷ globalB ↦ (default_val go_string) ∗
